available.Wording:
De Here is mijn Herder, mij ontbreekt niets. Hij doet mij nederliggen in grazige weiden; Hij voert mij aan rustige wateren; Hij verkwikt mijn ziel. Hij leidt mij in de rechte sporen om zijns naams wil. Zelfs al ga ik door een dal van diepe duisternis, ik vrees geen kwaad,
want Gij zijt bij mij; uw stok en uw staf, die vertroosten mij. Gij richt voor mij een dis aan voor de ogen van wie mij benauwen;
Gij zalft mijn hoofd met olie, mijn beker vloeit over. Ja, heil en goedertierenheid zullen mij volgen al de dagen van mijn leven; ik zal in het huis des HEREN verblijven tot in lengte van dagen.

The Lord bless you and keep you;
The Lord make His face shine upon you,
And be gracious to you;
The Lord lift up His countenance upon you,
And give you peace.

